webpackJsonp([0x81b8806e4260],{362:function(n,a){n.exports={data:{site:{siteMetadata:{navigation:[{path:"/player-config",title:"Configuration"},{path:"/video-source",title:"Video source"},{path:"/api",title:"API reference"},{path:"/modules",title:"Modules"},{path:"/events",title:"Player events"},{path:"/adapters",title:"Playback adapters"}]}},page:{frontmatter:{layout:"simple",title:"video-player.js",include:null},headings:[{depth:1,value:"video-player.js"},{depth:2,value:"How to use"}],html:'<h1 id="video-playerjs"><a href="#video-playerjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>video-player.js</h1>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://static.parastorage.com/unpkg/video-player@2.0.43/dist/statics/video-player.bundle.min.js<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span><span class="token punctuation">></span></span><span class="token script language-javascript">\n  <span class="token keyword">var</span> VideoPlayer <span class="token operator">=</span> window<span class="token punctuation">.</span>VideoPlayer<span class="token punctuation">;</span>\n</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<aside class="notice">\nIntegrate a video player into the product you’re working on – no hassle, no fuss, just nice and easy code for you to incorporate in your project.\n</aside>\n<p>The video player supports the following video formats: <code>MP4</code>, <code>WebM</code>, <code>HLS</code>, <code>DASH</code> manifest. Read more about <a href="/video-source">Video Source</a>.</p>\n<p>To install the stable version use <a href="https://www.npmjs.com/" target="_blank" rel="nofollow noopener noreferrer">npm</a>.</p>\n<h2 id="how-to-use"><a href="#how-to-use" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>How to use</h2>\n<div class="gatsby-highlight">\n      <pre class="language-jsx"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span> <span class="token attr-name">id</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>content<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">></span></span>\n\n<span class="token comment">// javascript</span>\n\n<span class="token keyword">import</span> VideoPlayer <span class="token keyword">from</span> <span class="token string">\'video-player\'</span><span class="token punctuation">;</span>\n\ndocument<span class="token punctuation">.</span><span class="token function">addEventListener</span><span class="token punctuation">(</span><span class="token string">\'DOMContentLoaded\'</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">const</span> player <span class="token operator">=</span> VideoPlayer<span class="token punctuation">.</span><span class="token function">create</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n    size<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n      width<span class="token punctuation">:</span> <span class="token number">700</span><span class="token punctuation">,</span>\n      height<span class="token punctuation">:</span> <span class="token number">394</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n    src<span class="token punctuation">:</span> <span class="token string">\'http://my-url/video.mp4\'</span><span class="token punctuation">,</span>\n    preload<span class="token punctuation">:</span> <span class="token string">\'metadata\'</span>\n  <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n  player<span class="token punctuation">.</span><span class="token function">attachToElement</span><span class="token punctuation">(</span>document<span class="token punctuation">.</span><span class="token function">getElementById</span><span class="token punctuation">(</span><span class="token string">\'content\'</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Check page with info about <a href="/player-config">config object</a></p>\n<p>After that just choose what you want to configure, create object with proper fields and pass it to <code>VideoPlayer.create</code>.</p>\n<p>It will return instance of player. You can later modify the instance (for example, as a reaction to user input) with the  <a href="/player-public-methods">public methods</a>.</p>\n<p>To place it somewhere in your structure, just call <a href="/player-public-methods#attachtoelement"><code>attachToElement</code></a></p>\n<p>It\'s really important to call <code>attachToElement</code> after <code>DOMContentLoaded</code> event due to <a href="https://github.com/marcj/css-element-queries" target="_blank" rel="nofollow noopener noreferrer">css-element-query</a></p>'}},pathContext:{}}}});
